import React from 'react';

function App() {
  return (
    <div>
      <h1>Grupo G13</h1>
      <h1>Inicio de Sesion</h1>
      <h2>Bienvenido, ingrese sus credenciales</h2>
      <input placeholder="Email"/>
      <input placeholder="Password"/>
      <button>Ingresar</button>
      <button>Crear Cuenta</button>
    </div>
  );
}
export default App;
